import React from "react";
import Text from "./Text";
import Pro from "./Pro";
import SearchParams from "..SearchParams";

const App = () => {
  return (
    <React.Fragment>
      <h1>Hello world</h1>
      <Text name="dude" />
      <Pro name="louay" />
      <SearchParams />
    </React.Fragment>
  );
};

export default App;
